import Link from 'next/link';

const AppLayout = ({ children }) => {
  return (
    <div>
      <div>
        <Link href="/">
          <a>Nodebird</a>
        </Link>
        <Link href="/profile">
          <a>Profile</a>
        </Link>
        <Link href="/signup">
          <a>Signup</a>
        </Link>
      </div>
      {children}
    </div>
  );
};

export default AppLayout;
